import React from "react";
import { Fragment, useContext } from "react/cjs/react.production.min";
import BtClicked from "../../Context/Button-clicked";
import './logo.css';

const Logo=(props)=>{

    const clicked=useContext(BtClicked);

    return(
        <Fragment>
            
           {clicked.isClicked &&  <a href="#home" className="dec">
            <div  className={`logo_container ${props.scrollDet>99?"shift":""}`}>
                <div className="circle"></div>
                <div className="name">
                    <h1 className="logo_name">PRI</h1>
                    <div className="triangle"></div>
                    <h1 className="logo_name">NS_</h1>
                </div>
            </div>
            </a>}
            
        </Fragment>
    );
}

export default Logo;
